import Image1 from "../../assets/eslam.jpg"
import Image2 from "../../assets/abdu.jpg"
import Image3 from "../../assets/moaz.jpg"


export const Data = [
    {
      id: 1,
      image: Image1,
      title: "Eslam Ahmad",
      comment: "الداخلية خسرت كتير جدا لما شهاب قرر مايخشهاش",
    },
    {
      id: 2,
      image: Image2,
      title: "Abdelrahman Abdelnasser",
      comment: "akhoia el tarsh elli mabyhazarsh",
    },
    {
      id: 3,
      image: Image3,
      title: "Moaz Askaar",
      comment: "فنانا الكبير اللي بتعلم منه ومن تواضعه وافق يكون صاحبي عادي جدا ويسيبني العب واكل عيش",
    },
  ]
